import React, { Component } from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import { withAutorization } from '../Autorization.js';

class Panier extends Component{

	handleClick(){
		console.log("test");
	}


	render(){
		return(
				<div class="box-panier box-2-panier">
					<h1>{this.props.inCart ? `Vous avez un panier avec ${this.props.quantity} éléments` : "Votre panier est vide"}</h1>
					<h3>
					{this.props.covid19 != 0 ? `Vous avez ${this.props.covid19} Covid-19` : ""}
					</h3>
					{this.props.covid19 != 0 ? React.createElement('button', { class: 'bouton' }, 'Supprimer 1') : ""}
					{this.props.covid19 != 0 ? React.createElement('button', { class: 'bouton' }, 'Tout supprimer ') : ""}
					
					<h3>
					{this.props.covid18 != 0 ? `Vous avez ${this.props.covid18} Covid-18` : ""}
					</h3>
					{this.props.covid18 != 0 ? React.createElement('button', { class: 'bouton' }, 'Supprimer 1') : ""}
					{this.props.covid18 != 0 ? React.createElement('button', { class: 'bouton' }, 'Tout supprimer ') : ""}
					<h3>
					{this.props.covid17 != 0 ? `Vous avez ${this.props.covid17} Covid-17` : ""}
					</h3>
					{this.props.covid17 != 0 ? React.createElement('button', { class: 'bouton', onClick: 'handleClick()' }, 'Supprimer 1') : ""}
					{this.props.covid17 != 0 ? React.createElement('button', { class: 'bouton' }, 'Tout supprimer ') : ""}
				</div>	
			)
	}

    
}

export default withAutorization(Panier);
